import React from 'react';

const Register = () => {
  return (
    <form action='localhost:5000/users/register' method='post'>
    <label htmlFor='email'>Email:</label>
    <input name='email' type='email' id='email'/>
    <button type='submit'>Submit</button>
    </form>
  )
}

export default Register;
